def getPositions(array, lower, upper):
	i = 0
	lowerPos = 0
	upperPos = len(array)-1
	
	while True:
		if(array[i] >= lower):
			lowerPos = i
			break
		i+=1


	while True:
		if(array[i] >= upper):
			upperPos = i
			break
		i+=1
		
	return (lowerPos, upperPos)

def mtie_t0(t0, tau, error):
	minV=100000000000
	maxV=0

	for t in range(t0, t0+tau):
		value = error[t]
		if value <minV:
			minV=value
		if value>maxV:
			maxV=value

	return maxV - minV

def mtie_S(S, error):
	maxV=0
	T=len(error)
	for t0 in range(0, T-S+1): # +1 to include the border
		value = mtie_t0(t0, S, error)
		if value>maxV:
			maxV=value
	return maxV



def mtie(error):
	result = []
	T=len(error)
	for S in range(1, T+1): # +1 because we want a window S of size T
		result+= [mtie_S(S, error)]

	return result


def mtie_dyn(error):
	size=len(error)
	minMat=np.zeros((size,size))
	maxMat=np.zeros((size,size))
	mtieMat=np.zeros((size,size))
	
	for i in range(0, size):
		minMat[0,i]=i
		maxMat[0,i]=i

	for i in range(0,size):
		for j in range(1, size-i):
			minMat[j,i]= minMat[j-1,i] if (error[int(minMat[j-1,i])] < error[i+j]) else i+j
			maxMat[j,i]= maxMat[j-1,i] if (error[int(maxMat[j-1,i])] > error[i+j]) else i+j
			mtieMat[j,i]= error[int(maxMat[j,i])] - error[int(minMat[j,i])]


	result=[]
	for i in range(0, len(error)):
		result+= [int(np.max(mtieMat[i]))]

	return result


